<head>
<meta charset="utf-8">
<meta name="viewport" content="width=device-width, initial-scale=1">
<title>WEP Global Tech â€“ Secure Access</title>
<style>
  body {
    margin: 0;
    height: 100vh;
    background: radial-gradient(circle at center, #10172a 0%, #000 100%);
    display: flex;
    justify-content: center;
    align-items: center;
    color: #e5e7eb;
    font-family: system-ui, -apple-system, 'Segoe UI', Roboto, Ubuntu, sans-serif;
    overflow: hidden;
  }
  #bg-glow {
    position: absolute;
    width: 100vw;
    height: 100vh;
    background: radial-gradient(600px at 50% 40%, rgba(96,165,250,.2), transparent);
    animation: pulse 6s infinite alternate;
    z-index: 0;
  }
  @keyframes pulse {
    from { opacity: 0.4; transform: scale(1); }
    to { opacity: 1; transform: scale(1.1); }
  }
  #login-box {
    position: relative;
    background: rgba(15,23,42,.9);
    border: 1px solid #1f2937;
    border-radius: 20px;
    padding: 32px 40px;
    text-align: center;
    box-shadow: 0 0 30px rgba(96,165,250,.4);
    z-index: 1;
    width: min(90%, 380px);
  }
  img.logo {
    width: 120px;
    height: auto;
    margin-bottom: 16px;
    animation: slowspin 50s linear infinite reverse; /* East-to-West */
    filter: drop-shadow(0 0 10px rgba(96,165,250,.6));
  }
  @keyframes slowspin {
    from { transform: rotate(0deg); }
    to { transform: rotate(-360deg); }
  }
  h2 {
    font-size: 1.3rem;
    margin: 8px 0 4px;
    color: #60a5fa;
  }
  h3 {
    margin: 0 0 20px;
    font-size: 0.95rem;
    color: #94a3b8;
    font-weight: 500;
  }
  input {
    width: 100%;
    padding: 12px;
    border-radius: 8px;
    border: 1px solid #374151;
    background: #0b1220;
    color: #e5e7eb;
    margin-top: 12px;
    font-size: 1rem;
  }
  button {
    background: #60a5fa;
    color: #0b1220;
    border: none;
    font-weight: bold;
    padding: 12px 16px;
    border-radius: 10px;
    margin-top: 16px;
    cursor: pointer;
    width: 100%;
    font-size: 1rem;
  }
  button:hover {
    box-shadow: 0 0 12px rgba(96,165,250,.5);
  }
  #error { color: #f87171; font-size: 14px; margin-top: 8px; display: none; }
  iframe { width: 100%; height: 100vh; border: none; display: none; }

  /* Responsive Design */
  @media (max-width: 600px) {
    body {
      background: radial-gradient(circle at center, #111b2e 0%, #000 100%);
    }
    #bg-glow {
      opacity: 0.3;
      background: radial-gradient(400px at 50% 45%, rgba(96,165,250,.15), transparent);
    }
    #login-box {
      width: 90%;
      padding: 28px 24px;
      background: rgba(15,23,42,.92);
      box-shadow: 0 0 20px rgba(96,165,250,.25);
    }
    img.logo {
      width: 90px;
      margin-bottom: 14px;
    }
    h2 { font-size: 1.1rem; }
    h3 { font-size: 0.85rem; }
    input, button { font-size: 0.95rem; padding: 10px; }
  }
</style>

    <p style="color:#94a3b8;font-size:14px;">Enter your access PIN to continue to the Master Toâ€‘Do Board</p>
    <input type="password" id="pin" placeholder="Enter PIN">
    <button id="submit">Unlock</button>
    <div id="error">Incorrect PIN. Please try again.</div>
  </div>
  <iframe id="boardFrame" src="wepgt_todo_board.html"></iframe>

<script>
const CORRECT_PIN = "2025"; // Change this anytime
const submitBtn = document.getElementById('submit');
const pinInput = document.getElementById('pin');
const errorMsg = document.getElementById('error');
const loginBox = document.getElementById('login-box');
const frame = document.getElementById('boardFrame');

function unlock() {
  const entered = pinInput.value.trim();
  if (entered === CORRECT_PIN) {
    loginBox.style.display = 'none';
    frame.style.display = 'block';
    localStorage.setItem('wepgt_access', 'granted');
  } else {
    errorMsg.style.display = 'block';
  }
}

submitBtn.addEventListener('click', unlock);
pinInput.addEventListener('keypress', e => {
  if (e.key === 'Enter') unlock();
});

window.onload = () => {
  const access = localStorage.getItem('wepgt_access');
  if (access === 'granted') {
    loginBox.style.display = 'none';
    frame.style.display = 'block';
  }
};
</script>
</body>
</html>
